import React from "react";
import "./Table.css";

const ChapterContent = ({ subTopicData }) => {
  const { title, levels } = subTopicData;

  return (
    <div className="containers">
      <h2 className="subject-title">{title || "Untitled Subtopic"}</h2>
      
      <table className="content-table">
        <thead>
          <tr>
            <th>Basic Level</th>
            <th>Intermediate Level</th>
            <th>Advanced Level</th>
            <th>Local NPTEL</th>
            <th>Live Video</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            {/* Basic Level */}
            <td>
              {levels.basic && levels.basic.length > 0 ? (
                levels.basic.map((item, index) => (
                  <div key={index} className="content-item">
                    <h5>{item.title || "No Title Available"}</h5>
                    <p>{item.description || "No Description Available"}</p>
                    <p>Rating: {item.rating || "N/A"}/5</p>
                    {item.link && (
                      <a href={item.link} target="_blank" rel="noopener noreferrer">
                        Read More
                      </a>
                    )}
                  </div>
                ))
              ) : (
                <p>No Basic Level Content Available</p>
              )}
            </td>

            {/* Intermediate Level */}
            <td>
              {levels.intermediate && levels.intermediate.length > 0 ? (
                levels.intermediate.map((item, index) => (
                  <div key={index} className="content-item">
                    <h5>{item.title || "No Title Available"}</h5>
                    <p>{item.description || "No Description Available"}</p>
                    <p>Rating: {item.rating || "N/A"}/5</p>
                    {item.link && (
                      <a href={item.link} target="_blank" rel="noopener noreferrer">
                        Read More
                      </a>
                    )}
                  </div>
                ))
              ) : (
                <p>No Intermediate Level Content Available</p>
              )}
            </td>

            {/* Advanced Level */}
            <td>
              {levels.advanced && levels.advanced.length > 0 ? (
                levels.advanced.map((item, index) => (
                  <div key={index} className="content-item">
                    <h5>{item.title || "No Title Available"}</h5>
                    <p>{item.description || "No Description Available"}</p>
                    <p>Rating: {item.rating || "N/A"}/5</p>
                    {item.link && (
                      <a href={item.link} target="_blank" rel="noopener noreferrer">
                        Read More
                      </a>
                    )}
                  </div>
                ))
              ) : (
                <p>No Advanced Level Content Available</p>
              )}
            </td>

            {/* Local NPTEL */}
            <td>
              {levels.nptel && levels.nptel.length > 0 ? (
                levels.nptel.map((item, index) => (
                  <div key={index} className="content-item">
                    <h5>{item.title || "No Title Available"}</h5>
                    <p>{item.description || "No Description Available"}</p>
                    <p>Rating: {item.rating || "N/A"}/5</p>
                    {item.link && (
                      <a href={item.link} target="_blank" rel="noopener noreferrer">
                        Read More
                      </a>
                    )}
                  </div>
                ))
              ) : (
                <p>No NPTEL Content Available</p>
              )}
            </td>

            {/* Live Video */}
            <td>
              {levels.livevideo && levels.livevideo.length > 0 ? (
                levels.livevideo.map((item, index) => (
                  <div key={index} className="content-item">
                    <h5>{item.title || "No Title Available"}</h5>
                    <p>{item.description || "No Description Available"}</p>
                    <p>Rating: {item.rating || "N/A"}/5</p>
                    {item.link && (
                      <a href={item.link} target="_blank" rel="noopener noreferrer">
                        Read More
                      </a>
                    )}
                  </div>
                ))
              ) : (
                <p>No Live Video Content Available</p>
              )}
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default ChapterContent;
